import axios from "axios";

export const getEco = async () => {
  try {
    const res = await axios.get("/economy");
    let eco = [];
    for (let x of res.data) {
      eco.push(x);
    }
    return {
      economy: eco,
    };
  } catch (e) {
    console.log(e);
  }
};
